// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MyNavbar from './components/Navbar';  // Importa a Navbar
import Curriculum from './components/Curriculum';  // Importa o componente de Currículo
import Footer from './components/Footer';  // Importa o Footer

function App() {
  return (
    <Router>
      <MyNavbar />  {/* Navbar com links */}
      <div style={{ marginTop: '80px' }}> {/* Ajuste para o conteúdo não ficar por baixo da navbar fixa */}
        <Routes>
          <Route path="/exibir" element={<Curriculum />} />  {/* Rota para Exibir Currículo */}
          <Route path="/editar" element={<Curriculum />} />   {/* Rota para Editar Currículo */}
        </Routes>
      </div>
      <Footer />  {/* Barra de rodapé */}
    </Router>
  );
}

export default App;
